import React, { useContext } from "react";
import { NavbarBrand } from "reactstrap";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { Link } from "react-router-dom";
import { UserContext } from "../App";
import Style from "./navbar.module.css";
const Headers = () => {
  const { state, dispatch } = useContext(UserContext);
  const Rendermenu = () => {
    if (state) {
      return (
        <>

          <Link className={ Style.navlink} to="/">Home</Link>

          <Link className={ Style.navlink} to="/Dashboard">Profile</Link>

          <Link className={ Style.navlink} to="/Logout">Logout</Link>
        </>
      );
    } else {
      return (
        <>
          <Link className={ Style.navlink} to="/">Home</Link>

          <Link className={ Style.navlink} to="/Register">Register</Link>

          <Link className={ Style.navlink} to="/Login">Login</Link>
        </>
      );
    }
  };
  return (
    <div className="container">
      <Nav className={ Style.NavbarItems}>
        <Navbar color="light" light expand="md">
          <NavbarBrand className="nav-brand">
            <Link className='navbar-logo' to="/">cafe shop</Link>
          </NavbarBrand>
          <div className='menu-icon' onClick={this.handleClick}>
      <i className={this.state.clicked ? "fas fa-times" : "fas fa-bars"}></i>
    </div>

    <ul className={this.state.clicked ? "nav-menu active" : "nav-menu"}></ul>
         
            <Rendermenu />
         
        </Navbar>
      </Nav>
      <hr></hr>
    </div>
  );
};

export default Headers;
